import 'bootstrap/dist/css/bootstrap.min.css';
import "../Styles/MainStyle.css";
import "../Styles/faq.css";
import $ from "jquery";
import React, { useRef, useState, useEffect } from 'react';

function FAQ() {
    let classMainName = "question-item";
    let classActive = "activeAnswer";
    let classActiveBorder = "active-border";

    useEffect(() => {
        $('.question-item').on('click', function (e) {
            e.preventDefault();
            const clickedItem = $(this);

            if (clickedItem.hasClass(classActive)) {
                clickedItem.removeClass(classActive);
                clickedItem.removeClass(classActiveBorder);
            } else {
                $('.question-item').removeClass(classActive);
                $('.question-item').removeClass(classActiveBorder);
                clickedItem.addClass(classActive);
                clickedItem.addClass(classActiveBorder);
            }
        });
    }, []); // Added empty dependency array to run useEffect only once on mount

    return (
        <div className="block-faq">
            <div className="container">
                <div className="block-name-faq">
                    FAQ
                </div>
                <div className="question">
                    <div className={classMainName}>
                        <div className="question-header">
                            <div className="question-title block-title">
                                Кто непосредственно занимается поддержкой?
                            </div>
                            <button className="question-toggle"></button>
                        </div>
                        <div className="question-content">
                            <p>
                                Сайты поддерживают штатные сотрудники ООО «Инитлаб», г. Краснодар, прошедшие специальное
                                обучение и имеющие опыт работы с Друпал от 4 до 15 лет: 8 web-разработчиков, 2 специалиста
                                по SEO, 4 системных администратора.
                            </p>
                        </div>
                    </div>
                    <div className={classMainName}>
                        <div className="question-header">
                            <div className="question-title">
                                Как организована работа поддержки?
                            </div>
                            <button className="question-toggle"></button>
                        </div>
                        <div className="question-content">
                            <p>
                                Клиент выбирает один из тарифов и делает предоплату. Все заявки на работы по сайту заводятся
                                в нашу систему Service desk. В течение времени реакции по тарифу закрепленный за проектом
                                специалист приступает к выполнению заявки, фиксирует время, потраченное на выполнение
                                заявки и закрывает заявку по окончанию работы. Клиент может посмотреть все заявки в работе и
                                отработанные часы в своем кабинете через веб-интерфейс.
                            </p>
                        </div>
                    </div>
                    <div className={classMainName}>
                        <div className="question-header">
                            <div className="question-title">
                                Можно ли пообщаться со специалистом голосом или в мессенджере?
                            </div>
                            <button className="question-toggle"></button>
                        </div>
                        <div className="question-content">
                            <p>
                                Для этого нужно написать заявку на консультацию на email поддержки и сообщить удобное время
                                и контактные данные.
                            </p>
                        </div>
                    </div>





                    <div className={classMainName}>
                        <div className="question-header">
                            <div className="question-title">
                                Можно ли пообщаться со специалистом голосом или в мессенджере?
                            </div>
                            <button className="question-toggle"></button>
                        </div>
                        <div className="question-content">
                            <p>
                                Для этого нужно написать заявку на консультацию на email поддержки и сообщить удобное время
                                и контактные данные.
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default FAQ;
